paths:
  tmp0:
    post:
      description: Get AlertCenter alerts from GSuite
      parameters:
      - description: Filter string to filter alert results
        example: createTime >= "2017-01-01T00:00:00Z" AND createTime < "2018-01-01T00:00:00Z"
        in: query
        name: Filter String
        required: false
        schema: {type: string}
      - description: Filter string to use when state tracking is enabled
        example: createTime >= "{last_run}"
        in: query
        name: State Filter String
        required: false
        schema: {type: string}
      - description: Field to use for state tracking
        example: createTime
        in: query
        name: State Field
        required: false
        schema: {type: string}
      - description: Clear the state attached to this task
        example: 'True'
        in: query
        name: Clear State
        required: true
        schema: {type: boolean}
      - description: Track the state of this query using the State Field
        example: 'True'
        in: query
        name: Track State
        required: true
        schema: {type: boolean}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp0'}
          description: Successful request
      summary: GSuite AlertCenter Get Alerts
  tmp1:
    post:
      description: Drive Delete File from GSuite
      parameters:
      - description: File ID of file to delete
        example: ''
        in: query
        name: ID
        required: false
        schema: {type: string}
      - description: Optionally override delegate account from GSuite asset
        example: user@example.org
        in: query
        name: Delegate Account
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp1'}
          description: Successful request
      summary: Drive Delete File
  tmp10:
    post:
      description: Create new Mail export
      parameters:
      - description: Matter to create new export under
        example: 833e043b-c9cf-4ed6-9cb0-162735a9373a
        in: query
        name: Matter ID
        required: true
        schema: {type: string}
      - description: New Unique Export Name
        example: ''
        in: query
        name: Export Name
        required: true
        schema: {type: string}
      - description: Scope of data to export. Must be one of ALL_DATA, HELD_DATA,
          UNPROCESSED_DATA
        example: ''
        in: query
        name: Data Scope
        required: true
        schema: {type: string}
      - description: Mailbox export format. Must be one of MBOX, PST. Defaults to
          MBOX
        example: ''
        in: query
        name: Export Format
        required: false
        schema: {type: string}
      - description: Export filter terms
        example: has:attachment is:sent -label:drafts
        in: query
        name: Query Terms
        required: false
        schema: {type: string}
      - description: Enable to exclude drafts from export. Defaults to true
        example: ''
        in: query
        name: Exclude Drafts
        required: false
        schema: {type: boolean}
      - description: CSV list of email addresses to target. Must provide this or Organization
          Unit Path
        example: user1@example.org,user2@example.org
        in: query
        name: Email Addresses
        required: false
        schema: {type: string}
      - description: Full path to OU or OU id (root OU must use id, see README for
          more info). Must provide this or Email Addresses
        example: /full/path/to/ou OR id:asdf71fh140hg
        in: query
        name: Organization Unit Path
        required: false
        schema: {type: string}
      - description: Filter to messages sent after this time (ISO-8601 format)
        example: '2017-04-02T00:00:00Z'
        in: query
        name: Start Time
        required: false
        schema: {type: string}
      - description: Filter to messages sent before this time (ISO-8601 format)
        example: '2017-04-02T00:00:00Z'
        in: query
        name: End Time
        required: false
        schema: {type: string}
      - description: Optionally override delegate account from GSuite asset
        example: user@example.org
        in: query
        name: Delegate Account
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp10'}
          description: Successful request
      summary: GSuite Vault Create Mail Export
